import React, { Component } from 'react';
import cloudLogo from "./cloud.png";

export default class Footer extends Component {
  render() {
    return (
      <>
        <div className='h-[440px]' style={{
          background: `linear-gradient(90deg, rgba(15,209,139,1) 0%, rgba(48,219,201,1) 63%, rgba(69,249,252,1) 100%)`
        }}>
          <div className='lg:ml-[520px]'>
            <div className='flex'>
              <img src={cloudLogo} alt="CloudNotes Logo" className="h-12 w-12 ml-3 mt-8" />
              <h1 className='text-4xl font-bold text-black pt-10 pl-5 font-cursive lg:ml-20 lg:text-7xl' style={{ fontFamily: "'Dancing Script', cursive" }}>CloudNotes</h1>
            </div>

            <p className='text-black pl-5 pt-2 lg:pl-0'>
              Want to know what we're up to? Sign up for CloudNotes and join our tribe.
            </p>

            <h1 className='text-2xl text-black pt-14 pl-5 font-cursive lg:ml-16' style={{ fontFamily: "'Dancing Script', cursive" }}>"Write Anywhere, Access Everywhere"</h1>

            <div className='mt-16 lg:ml-16'>
              <p className='text-black pl-5 pt-2 mt-3 ml-6 text-[13px]'>
                Copyright @CloudNotes All Rights Reserved
              </p>
              <p className='text-black pl-5 pt-2 text-[16px]'>
                Created and Designed by Shubham Mamgain
              </p>
            </div>
          </div>
        </div>
      </>
    );
  }
}
